    var j = offset  /* index in unpacked array */
    val l = packed.length()
    while (i < l) {
      var count = packed.charAt(i).toInt; i += 1
      val value = packed.charAt(i); i += 1
      result(j) = value; j+=1
      count -= 1
      while (count > 0){
